import React from "react";

function Dashboard() {
  const savedJobs = [
    {
      id: 1,
      title: "UI Developer",
      company: "Tech Solutions",
      location: "Bangalore",
    },
    {
      id: 2,
      title: "Frontend Developer",
      company: "Web Labs",
      location: "Remote",
    },
  ];

  return (
    <div style={{ padding: "20px" }}>
      <h2>User Dashboard</h2>
      <h3>Saved Jobs</h3>

      {savedJobs.length === 0 ? (
        <p>No saved jobs yet</p>
      ) : (
        savedJobs.map((job) => (
          <div
            key={job.id}
            style={{
              border: "1px solid #ccc",
              padding: "15px",
              marginBottom: "10px",
              borderRadius: "8px",
            }}
          >
            <h4>{job.title}</h4>
            <p>{job.company}</p>
            <span>{job.location}</span>
          </div>
        ))
      )}
    </div>
  );
}

export default Dashboard;
